db.patients.aggregate([
    {
        $match: {"IMAGING_STUDIES.SERIES_UID": "1.2.840.99999999.1.35521005.1677140787722"}
    },
    {
        $unwind: "$IMAGING_STUDIES"
    },
    {
        $match: {"IMAGING_STUDIES.SERIES_UID": "1.2.840.99999999.1.35521005.1677140787722"}
    },
    {
        $project: {
             _id: 0,
             patient_id: "$PATIENT_ID",
             first: "$FIRST",
             last: "$LAST"
        }
    },
    {
        $group: {
            _id: {PATIENT_ID: "$patient_id", FIRST: "$first", LAST: "$last"}
        }
    },
    {
        $project: {
             _id: 0,
             patient_id: "$_id.PATIENT_ID",
             first: "$_id.FIRST",
             last: "$_id.LAST"
        }
    }
])

