db.patients.aggregate([
  {
    $unwind: "$ENCOUNTERS"
  },
  {
    $unwind: "$ENCOUNTERS.MEDICATIONS"
  },
  {
    $lookup: {
      from: "payers",
      localField: "ENCOUNTERS.MEDICATIONS.PAYER_REF",
      foreignField: "PAYER_ID",
      as: "payer_details"
    }
  },
  {
    $unwind: "$payer_details"
  },
  {
    $match: {
      "payer_details.NAME": "Cigna Health",
      "ENCOUNTERS.MEDICATIONS.PAYER_COVERAGE": null
    }
  },
  {
    $group: {
      _id: null,
      count: {
        $sum: 1
      }
    }
  },
  {
    $project: {
      _id: 0,
      uncovered_medications_count: "$count"
    }
  }
])

