db.patients.aggregate([
    {
        $lookup: {
            from: "payers",
            localField: "PAYER_TRANSITIONS.PAYER_REF",
            foreignField: "PAYER_ID",
            as: "payer_details"
        }
    },
    {
        $unwind: "$PAYER_TRANSITIONS"
    },
    {
        $unwind: "$payer_details"
    },
    {
        $match: {
            "payer_details.PAYER_ID": "0133f751-9229-3cfd-815f-b6d4979bdd6a"
        }
    },
    {
        $unwind: "$ENCOUNTERS"
    },
    {
        $lookup: {
            from: "claims",
            localField: "ENCOUNTERS.ENCOUNTER_ID",
            foreignField: "ENCOUNTER_REF",
            as: "claim_details"
        }
    },
    {
        $unwind: "$claim_details"
    },
    {
        $project: {
            total_claim_cost: "$claim_details.TOTAL_CLAIM_COST"
        }
    },
    {
        $group: {
            _id: "$ENCOUNTERS.ENCOUNTER_ID",
            total_cost: { $sum: "$total_claim_cost" }
        }
    },
    {
        $project: {
            _id: 0,
            total_cost: "$total_cost"
        }
    },
    {
        $match: {
            total_cost: 0
        }
    },
    {
        $group: {
            _id: null,
            total_uncovered_encounters: { $sum: 1 }
        }
    },
    {
        $project: {
            _id: 0,
            total_uncovered_encounters: "$total_uncovered_encounters"
        }
    }
])

